import { CdkDragDrop, moveItemInArray } from '@angular/cdk/drag-drop';
import { Component, OnInit, ViewChild } from '@angular/core';
import { FormControl } from '@angular/forms';
import { MatAutocompleteSelectedEvent } from '@angular/material/autocomplete';
import { MatTable } from '@angular/material/table';

@Component({
  selector: 'app-autocomplete-actores',
  templateUrl: './autocomplete-actores.component.html',
  styleUrls: ['./autocomplete-actores.component.css']
})
export class AutocompleteActoresComponent implements OnInit {
  
  formControl: FormControl = new FormControl();

  actores = [
    {
      key:1,
      nombre: 'Thom Holand',
      foto: 'data:image/jpeg;base64,',
      personaje: 'Harry'    
    },
    {
      key:2,
      nombre: 'Andres Holand',
      foto: 'data:image/jpeg;base64,',
      personaje: 'Harry'    
    },
    {
      key:3,
      nombre: 'Francisco Holand',
      foto: 'data:image/jpeg;base64,',
      personaje: 'Harry'    
    },
    {
      key:4,
      nombre: 'Raul Holand',
      foto: 'data:image/jpeg;base64,',
      personaje: 'Harry'    
    },
    {
      key:5,
      nombre: 'Marcelo Holand',
      foto: 'data:image/jpeg;base64,',
      personaje: 'Harry'    
    },
    {
      key:6,
      nombre: 'Marisel Holand',
      foto: 'data:image/jpeg;base64,',
      personaje: 'Harry'    
    }
  ]

  actoresOriginales = this.actores;

  actoresSeleccionados: any = [];

  displayedColumns: string[] = ['key','foto' ,'nombre', 'personaje', 'acciones'];

  @ViewChild(MatTable)
  table!: MatTable<any>;

  constructor(){}

  ngOnInit(): void {
    this.formControl.valueChanges.subscribe(val => {
      this.actores = this.actoresOriginales;
      this.actores = this.actores.filter(actor => actor.nombre.indexOf(val) !== -1)
    })      
  }


  optionSelected(event: MatAutocompleteSelectedEvent): void
  {
      console.log(event.option.value)
      if(this.actoresSeleccionados.indexOf(event.option.value) === -1){
        this.actoresSeleccionados.push(event.option.value)
      }
      
      this.formControl.patchValue('')
      if(this.table !== undefined)
      {
        this.table.renderRows();
      }
  }

  eliminar(actor)
  {
   const index = this.actoresSeleccionados.findIndex(a => a.key == actor.key);
   if(index !== -1){
    this.actoresSeleccionados.splice(index,1);
    this.table.renderRows();
   }
  }

  finalizarArrastre(event: CdkDragDrop<any[]>)
  {
    const indexPrevious = this.actoresSeleccionados.findIndex(a => a === event);
    moveItemInArray(this.actoresSeleccionados, indexPrevious, event.currentIndex);
    this.table.renderRows();
  }
}
